import { useState } from "react";
import { FaHeart, FaBell, FaLightbulb, FaBars } from "react-icons/fa";
import { IoMdLogOut } from "react-icons/io";

const Dashboard = () => {
  const [isOpen, setIsOpen] = useState(true);

  return (
    <div className="flex min-h-screen bg-green-100">
      {/* Sidebar */}
      <div
        className={`bg-white p-5 w-64 transition-all ${isOpen ? "block" : "hidden"} md:block`}
      >
        <h2 className="text-xl font-bold">CycleCare</h2>
        <nav className="mt-5">
          <ul>
            <li className="p-2 flex items-center gap-2 text-green-700 font-semibold">
              <FaHeart /> Tracker
            </li>
            <li className="p-2 flex items-center gap-2">
              <FaBell /> Mood Tracker
            </li>
            <li className="p-2 flex items-center gap-2">
              <FaLightbulb /> Health Tips
            </li>
          </ul>
        </nav>
      </div>

      {/* Main Content */}
      <div className="flex-1 p-6">
        {/* Top Bar */}
        <div className="flex justify-between items-center">
          <button className="md:hidden" onClick={() => setIsOpen(!isOpen)}>
            <FaBars size={24} />
          </button>
          <button className="bg-green-500 text-white px-4 py-2 rounded flex items-center gap-2">
            <IoMdLogOut /> Logout
          </button>
        </div>

        <h1 className="text-2xl font-bold mt-4">Welcome to Your Menstrual Tracker</h1>
        <p className="text-gray-600">Track, manage, and optimize your cycle health.</p>

        {/* Period Info */}
        <div className="grid grid-cols-2 gap-4 mt-4">
          <div className="bg-white p-4 rounded shadow">
            <p className="text-gray-600">Next Predicted Period</p>
            <p className="text-xl font-bold">March 15, 2025</p>
          </div>
          <div className="bg-white p-4 rounded shadow">
            <p className="text-gray-600">Current Phase</p>
            <p className="text-xl font-bold">Follicular</p>
          </div>
        </div>

        {/* Cards */}
        <div className="grid md:grid-cols-2 gap-4 mt-6">
          <div className="bg-white p-4 rounded shadow">
            <h3 className="font-bold">Track Your Cycle</h3>
            <p>Monitor your cycle length, predict periods, and get insights.</p>
          </div>
          <div className="bg-white p-4 rounded shadow">
            <h3 className="font-bold">Track Your Mood</h3>
            <p>Log your mood daily to identify patterns and improve mental health.</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;


